-- Volcando estructura para función ceit.fn_getConfiguracion
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` FUNCTION `fn_getConfiguracion`(`p_parameterKey` VARCHAR(50)) RETURNS decimal(10,2)
    READS SQL DATA
BEGIN
	DECLARE v_return DECIMAL(10,2);
	
	SELECT
		t1.Valor
	INTO
		v_return
	FROM
		configuraciones AS t1
	WHERE
		t1.Clave = p_parameterKey;
		
	RETURN v_return;
END//
DELIMITER ;


