DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` FUNCTION `fn_StringSplit`(`x` VARCHAR(255), `delim` VARCHAR(12), `pos` INT
) RETURNS varchar(255) CHARSET utf8 COLLATE utf8_spanish_ci
