-- Volcando estructura para procedimiento ceit.sp_InsertDocentes_Detmpdocentes
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_InsertDocentes_Detmpdocentes`()
    MODIFIES SQL DATA
BEGIN
	DECLARE pContador INT DEFAULT 0;	
	DECLARE done INT DEFAULT 0;
	DECLARE pIdPersona INT;
   DECLARE documento INT;
   DECLARE plegajo VARCHAR(10);
   DECLARE cursorDocentes CURSOR
   FOR
   SELECT t1.DNI,t1.Legajo FROM tmpdocentes as t1;
   DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done=1;

	OPEN cursorDocentes;
	REPEAT
		FETCH cursorDocentes INTO documento,plegajo;
	IF NOT done THEN		
		SET pContador = (SELECT COUNT(*) as counter FROM personas as p inner join docentes as doc on p.IdPersona = doc.IdPersona
		WHERE p.DNI = documento);
		SET pIdPersona = (SELECT per.IdPersona FROM personas as per where per.DNI = documento);
		IF pContador = 0 THEN			
			VALUES(pIdPersona,plegajo);
		else
			UPDATE docentes
			SET Legajo = plegajo
			WHERE IdPersona = pIdPersona;
		END IF;
	END IF;
	UNTIL done END REPEAT;
   CLOSE cursorDocentes; 
END//
DELIMITER ;


