-- Volcando estructura para procedimiento ceit.sp_rptCajaGabinete
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_rptCajaGabinete`(IN `pDesde` DATE, IN `pHasta` DATE, IN `pTurno` INT, IN `pIdUsuario` INT)
    READS SQL DATA
BEGIN

	DECLARE consulta VARCHAR(20000);
	DECLARE consultaUnion VARCHAR(20000);
	
	SET consulta = 'SELECT IFNULL(SUM(c.SubTotal), 0) AS SubTotal
	FROM caja c inner join cajaitems ci on c.IdCaja = ci.IdCaja
	inner join pedidos ped on ci.IdPedido = ped.IdPedido 
	inner join pedidoitems peditem on ped.IdPedido = peditem.IdPedido
	inner join textos txt on peditem.IdTexto = txt.IdTexto
	WHERE c.IdCaja > -1 and ped.Especial = 1 and txt.CantPaginas < 50';
	
	IF pDesde IS NOT NULL AND pHasta IS NOT NULL THEN
		SET consulta = CONCAT(consulta,' and ped.Creado between ',pDesde,' and ',pHasta);		
	END IF;
	
	IF pTurno IS NOT NULL THEN
		IF pTurno = 1 THEN
			SET consulta = CONCAT(consulta,' and ped.IdFranja <= 2');
		END IF;		 
		IF pTurno = 2 THEN
			SET consulta = CONCAT(consulta,' and ped.IdFranja > 2');
		END IF;	
	END IF;	
	
	IF pIdUsuario IS NOT NULL THEN
		SET consulta = CONCAT(consulta,' and c.CreadoPor=',pIdUsuario);
	END IF;
		
	SET consultaUnion = CONCAT('SELECT SUM(c.SubTotal) as SubTotal FROM caja c INNER JOIN cajaitems ci ON c.IdCaja = ci.IdCaja WHERE c.Gabinete=1 AND ci.IdItem IS NOT NULL');
	
	SET consulta = CONCAT('SELECT IFNULL((t1.SubTotal),0) AS SubTotal FROM (', consulta, ' UNION ALL ',consultaUnion,') AS t1;');
	
	SELECT consulta;
	
	SET @sql_dinamico = consulta;
	PREPARE stmt FROM @sql_dinamico;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_rptCajaLocal
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_rptCajaLocal`(IN `pDesde` DATE, IN `pHasta` DATE, IN `pTurno` TINYINT, IN `pIdUsuario` INT)
    READS SQL DATA
BEGIN
	DECLARE consulta VARCHAR(20000);
	
	SET consulta = 'SELECT
						IFNULL(SUM(c.SubTotal), 0) AS SubTotal
					FROM
						caja AS c
						INNER JOIN usuarios AS u
							ON c.CreadoPor = u.IdUsuario
						INNER JOIN usuarioroles AS ur
							ON u.IdUsuario = ur.IdUsuario
					WHERE
						c.Gabinete = 0
						AND ur.IdRol IN (1, 4)';
	
	IF pDesde IS NOT NULL AND pHasta IS NOT NULL THEN
		SET consulta = CONCAT(consulta,' AND c.Creado BETWEEN \'', pDesde, '\' and \'', pHasta, '\'');
	END IF;
	
	IF pTurno IS NOT NULL THEN
		IF pTurno = 1 THEN
			SET consulta = CONCAT(consulta,' AND c.Creado <= \'15:00:00\'');
		END IF;		 
		IF pTurno = 2 THEN
			SET consulta = CONCAT(consulta,' AND c.Creado > \'15:00:00\'');
		END IF;	
	END IF;	
	
	IF pIdUsuario IS NOT NULL THEN
		SET consulta = CONCAT(consulta,' AND c.CreadoPor = ', pIdUsuario);
	END IF;
	
	SET consulta = CONCAT(consulta,';');
	
	-- SELECT consulta;
	
	SET @sql_dinamico = consulta;
	PREPARE stmt FROM @sql_dinamico;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_rptCantidadPedidos
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_rptCantidadPedidos`(IN `pDesde` DATE, IN `pHasta` DATE, IN `pIdFranja` INT, IN `pIdUsuario` INT)
    READS SQL DATA
BEGIN

		DECLARE Consulta VARCHAR(20000);
		
		SET Consulta = 'SELECT
							COUNT(ped.IdPedido) AS CantPedidos
						FROM
							pedidos AS ped
							INNER JOIN usuarios AS u
								ON ped.CreadoPor = u.IdUsuario
							INNER JOIN usuarioroles AS ur
								ON u.IdUsuario = ur.IdUsuario
						WHERE
							ped.IdPedido > -1
							AND ur.IdRol NOT IN (7, 8)';
		
		IF pDesde is not NULL and pHasta is not NULL THEN
			SET Consulta = CONCAT(Consulta, ' AND ped.Creado BETWEEN \'', pDesde, '\' AND \'', pHasta, '\'');
		END IF;
		
		IF pIdFranja IS NOT NULL THEN
			SET Consulta = CONCAT(Consulta,' AND ped.IdFranja = ',pIdFranja);
		END IF;
		
		IF pIdUsuario IS NOT NULL THEN
			SET Consulta = CONCAT(Consulta,' AND ped.IdUsuario = ',pIdUsuario);
		END IF;
		
		SET Consulta = CONCAT(Consulta,';');
		
		-- SELECT Consulta;
		
		SET @sql_dinamico = Consulta;
		PREPARE stmt FROM @sql_dinamico;
		EXECUTE stmt;
		DEALLOCATE PREPARE stmt;

END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_rptFacturacion
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_rptFacturacion`(IN `pDesde` DATE, IN `pHasta` DATE)
    READS SQL DATA
BEGIN
	SELECT
		'Sistema' AS Concepto,
		-- TotalSistemaApuntec
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
			INNER JOIN pedidos AS t3
				ON t2.IdPedido = t3.IdPedido
			INNER JOIN pedidoitems AS t4
				ON t3.IdPedido = t4.IdPedido
			INNER JOIN textos AS t5
				ON t4.IdTexto = t5.IdTexto
				AND t5.CantPaginas > 0
		WHERE
			t1.Gabinete = 0
			AND t2.IdPedido IS NOT NULL
			AND t1.Creado BETWEEN pDesde AND pHasta) AS Apuntec,
		-- TotalSistemaGabinete
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
			INNER JOIN pedidos AS t3
				ON t2.IdPedido = t3.IdPedido
			INNER JOIN pedidoitems AS t4
				ON t3.IdPedido = t4.IdPedido
			INNER JOIN textos AS t5
				ON t4.IdTexto = t5.IdTexto
				AND t5.CodInterno IS NULL
				AND t5.IdMateria IS NULL
				AND t5.CantPaginas > 0
		WHERE
			t1.Gabinete = 1
			AND t2.IdPedido IS NOT NULL
			AND t1.Creado BETWEEN pDesde AND pHasta) AS Gabinete
	
	UNION
	
	SELECT
		'Especiales' AS Concepto,
		-- TotalEspecialApuntec
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 0 
			AND t1.Creado BETWEEN pDesde AND pHasta
			AND (t2.IdItem = 'PES' OR t2.IdItem = 'PED')) AS Apuntec,
		-- Gabinete no tiene especiales.
		0 AS Gabinete
		
	UNION
	
	SELECT
		'Sueltas' AS Concepto,
		-- TotalSueltasApuntec
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 0
			AND t1.Creado BETWEEN pDesde AND pHasta
			AND (t2.IdItem = 'FSF' OR t2.IdItem = 'FDF')) AS Apuntec,
		-- TotalSueltasGabinete
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 1
			AND t1.Creado BETWEEN pDesde AND pHasta
			AND (t2.IdItem = 'FSF' OR t2.IdItem = 'FDF')) AS Gabinete
			
	UNION
	
	SELECT
		'Libreria' AS Concepto,
		-- TotalLibreriaApuntec
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 0
			AND t1.Creado BETWEEN pDesde AND pHasta
			AND t2.IdItem = 'LIB') AS Apuntec,
		-- TotalLibreriaGabinete
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 1
			AND t1.Creado BETWEEN pDesde AND pHasta
			AND t2.IdItem = 'LIB') AS Gabinete
			
	UNION
	
	SELECT
		'Anillado' AS Concepto,
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 0
			AND t1.Creado BETWEEN pDesde AND pHasta
			AND t2.IdItem = 'ANI') AS Apuntec,
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 1
			AND t1.Creado BETWEEN pDesde AND pHasta
			AND t2.IdItem = 'ANI') AS Gabinete
			
	UNION
	
	SELECT
		'Total' AS Concepto,
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 0
			AND t1.Creado BETWEEN pDesde AND pHasta) AS Apuntec,
		(SELECT
			IFNULL(SUM(t2.Cantidad * t2.PrecioUnitario), 0)
		FROM
			caja AS t1
			INNER JOIN cajaitems AS t2
				ON t1.IdCaja = t2.IdCaja
		WHERE
			t1.Gabinete = 1
			AND t1.Creado BETWEEN pDesde AND pHasta) AS Gabinete;

