-- Volcando estructura para procedimiento ceit.sp_rptFotocopias
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_rptFotocopias`(IN `pDesde` VARCHAR(50), IN `pHasta` VARCHAR(50), IN `pTurno` INT, IN `pSimple` BIT, IN `pDoble` BIT, IN `pSistema` BIT, IN `pEspecial` BIT, IN `pSueltos` BIT)
    READS SQL DATA
BEGIN
	declare conSueltas varchar(20000) DEFAULT NULL;
	declare conSistema varchar(20000) DEFAULT NULL;
	declare conEspecial varchar(20000) DEFAULT NULL;
	declare valorUnion INT DEFAULT 0;
	declare ConsultaFinal varchar(20000);
	declare VARIABLE varchar(20000);
	
	IF pSueltos = b'1' then
		SET conSueltas := 'SELECT CantPaginas FROM v_fotocopiasdigitales WHERE IdPedido > -1';
			CASE pTurno
				WHEN 1 THEN
					SET conSueltas := CONCAT(conSueltas,' and IdFranja <= 2');
				WHEN 2 THEN
					SET conSueltas := CONCAT(conSueltas,' and IdFranja > 2');
				ELSE
					SET conSueltas := conSueltas;
			END CASE;				
			
			IF pSimple is not NULL xor pDoble is not null THEN
				IF pSimple = b'1' THEN
					SET conSueltas := CONCAT(conSueltas,' and SimpleFaz=1');
				END IF;			
				IF pDoble = b'1' THEN
					SET conSueltas := CONCAT(conSueltas,' and SimpleFaz=0');
				END IF;				
			END IF;
			
			IF pDesde is not NULL and pHasta is not NULL THEN
				SET conSueltas := CONCAT(conSueltas,' and Creado_Caja between \'', pDesde,'\' and \'', pHasta, '\'');
			END IF;			
			
			SET valorUnion = 1;
			
			SET ConsultaFinal = conSueltas;
	END IF;
		
	IF pEspecial = b'1' THEN
		SET conEspecial := 'SELECT CantPaginas FROM v_fotocopiaespecial WHERE IdCaja > -1';		
			
			CASE pTurno
				WHEN 1 THEN
					-- SET conEspecial := CONCAT(conEspecial,' and Creado <= 2');
					SET conEspecial := conEspecial;
				WHEN 2 THEN
					-- SET conEspecial := CONCAT(conEspecial,' and Creado > 2');
					SET conEspecial := conEspecial;
				ELSE
					SET conEspecial := conEspecial;
			END CASE;				
			
			IF pSimple is not NULL xor pDoble is not null THEN
				IF pSimple = b'1' THEN
					SET conEspecial := CONCAT(conEspecial,' and IdItem = \'PES\'');
				END IF;			
				IF pDoble = b'1' THEN
					SET conEspecial := CONCAT(conEspecial,' and IdItem = \'PED\'');
				END IF;				
			END IF;
			
			IF pDesde is not NULL and pHasta is not NULL THEN
				SET conEspecial := CONCAT(conEspecial,' and Creado between \'', pDesde, '\' and \'', pHasta, '\'');
			END IF;	
			
			IF valorUnion = 1 THEN
				SET ConsultaFinal = CONCAT(ConsultaFinal,' UNION ALL ',conEspecial);
			ELSEIF valorUnion = 0 THEN
				SET ConsultaFinal = conEspecial;
				SET ValorUnion = 1;
			END IF;
	END IF;
	
	IF pSistema = b'1' THEN
			SET conSistema := 'SELECT CantPaginas FROM v_fotocopiasistema WHERE IdPedido > -1';		
			
			CASE pTurno
				WHEN 1 THEN
					SET conSistema := CONCAT(conSistema,' and IdFranja <= 2');
				WHEN 2 THEN
					SET conSistema := CONCAT(conSistema,' and IdFranja > 2');
				ELSE
					SET conSistema := conSistema;
			END CASE;				
			
			IF pSimple is not NULL xor pDoble is not null THEN
				IF pSimple = b'1' THEN
					SET conSistema := CONCAT(conSistema,' and SimpleFaz=1');
				END IF;			
				IF pDoble = b'1' THEN
					SET conSistema := CONCAT(conSistema,' and SimpleFaz=0');
				END IF;				
			END IF;
			
			IF pDesde is not NULL and pHasta is not NULL THEN
				SET conSistema := CONCAT(conSistema,' and Creado_Caja between \'', pDesde, '\' and \'', pHasta, '\'');
			END IF;	
		
			IF valorUnion = 1 THEN
				SET ConsultaFinal = CONCAT(ConsultaFinal,' UNION ALL ', conSistema);
			ELSEIF valorUnion = 0 THEN
				SET ConsultaFinal = conSistema;
			END IF;
	
	END IF;

	SET ConsultaFinal = CONCAT('SELECT IFNULL(SUM(t1.CantPaginas), 0) AS CantPaginas FROM (', ConsultaFinal,') AS t1;');
	
	-- SELECT ConsultaFinal AS Consulta;
	
	SET @sql_dinamico = ConsultaFinal;
	PREPARE stmt FROM @sql_dinamico;
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;
	
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selCajaCierreParcial
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selCajaCierreParcial`()
    READS SQL DATA
BEGIN
	IF(TIMEDIFF(CURRENT_TIME(), TIME('15:00:00')) <= 0) THEN
		SELECT
			SUM(t1.SubTotal) AS Total,
			'desde las 8 hs.' AS Tiempo
		FROM
			caja AS t1
		WHERE
			t1.Creado BETWEEN DATE_ADD(CURDATE(), INTERVAL 6 HOUR) AND NOW();
	ELSE
		SELECT
			SUM(t1.SubTotal) AS Total,
			'desde las 15 hs.' AS Tiempo
		FROM
			caja AS t1
		WHERE
			t1.Creado BETWEEN DATE_ADD(CURDATE(), INTERVAL 15 HOUR) AND NOW();
	END IF;
END//
DELIMITER ;


