DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selCarrerasByIdUsuario`(IN `p_idUsuario` INT)
    READS SQL DATA
BEGIN
	SELECT DISTINCT
		t2.IdCarrera,
		t2.Descripcion,
		IF(t3.IdUsuario IS NULL, '', 'selected') AS Seleccionado
	FROM
		estudiantes AS t1
		RIGHT JOIN carreras AS t2
			ON t1.IdCarrera = t2.IdCarrera
		LEFT JOIN usuarios AS t3
			ON t1.IdPersona = t3.IdPersona
			AND t3.IdUsuario = p_idUsuario
	ORDER BY
		t2.IdCarrera ASC;
END//
