-- Volcando estructura para procedimiento ceit.sp_selGabineteCaja
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selGabineteCaja`()
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPedido AS IdGabinetePedido,
		t6.Nombre,
		t6.Apellido,
		t6.DNI,
		t1.Retiro AS DiaRetiro,
		t4.Descripcion AS HorarioRetiro
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3 
			ON t2.IdTexto = t3.IdTexto
			AND t3.CodInterno IS NULL
			AND t3.IdMateria IS NULL
			AND t3.CantPaginas <= 50
		INNER JOIN horariofranjas AS t4
			ON t1.IdFranja = t4.IdHorarioFranja
		INNER JOIN usuarios AS t5
			ON t1.IdUsuario = t5.IdUsuario
		INNER JOIN personas AS t6 
			ON t5.IdPersona = t6.IdPersona
		INNER JOIN estudiantes AS t7 
			ON t6.IdPersona = t7.IdPersona
	WHERE
		t1.IdEstado IN (4) AND
		t1.Pagado = 0 AND
		t1.Especial = 0
	ORDER BY
		t1.Retiro ASC;
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selGabineteCajaByIdPedidoOrDNI
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selGabineteCajaByIdPedidoOrDNI`(IN `p_termBusqueda` VARCHAR(10))
    READS SQL DATA
BEGIN
	select
		t1.IdPedido AS IdGabinetePedido,
		t5.DNI,
		t5.Nombre,
		t5.Apellido,
		t1.Retiro AS DiaRetiro,
		t7.Descripcion AS HorarioRetiro
	from
		pedidos as t1
			inner join pedidoitems as t2
				on t1.IdPedido = t2.IdPedido
			inner join textos as t3
				on t2.IdTexto = t3.IdTexto
				and t3.CodInterno is null
				and t3.IdMateria is null
			inner join usuarios as t4
				on t1.IdUsuario = t4.IdUsuario
			inner join personas as t5
				on t4.IdPersona = t5.IdPersona
			left join estudiantes as t6
				on t5.IdPersona = t6.IdPersona
			inner join horariofranjas as t7
				on t1.IdFranja = t7.IdHorarioFranja
	where
		t1.IdEstado >= 3
		and
		t1.pagado = 0
		and
		t1.especial = 0
		and
		(t5.DNI like concat('%', p_termBusqueda, '%') or t1.IdPedido like concat('%', p_termBusqueda, '%'));
