-- Volcando estructura para procedimiento ceit.sp_selGabineteCajaPedido
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selGabineteCajaPedido`(IN `p_idPedido` INT)
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPedido,
		IFNULL(t1.Comentario, t3.Nombre) AS Descripcion,
		SUM((t3.CantPaginas * t2.Cantidad * fn_getConfiguracion('PrecioGabinete')) +
		CASE t1.Anillado
			WHEN 0 THEN IF(t2.Anillado, t2.Anillado * t2.Cantidad * fn_getConfiguracion('PrecioAnillado'), 0)
			WHEN 1 THEN fn_getConfiguracion('PrecioAnillado')
			ELSE NULL
		END) AS PrecioUnitario,
		1 AS Cantidad,
		SUM((t3.CantPaginas * t2.Cantidad * fn_getConfiguracion('PrecioGabinete')) +
		CASE t1.Anillado
			WHEN 0 THEN IF(t2.Anillado, t2.Anillado * t2.Cantidad * fn_getConfiguracion('PrecioAnillado'), 0)
			WHEN 1 THEN fn_getConfiguracion('PrecioAnillado')
			ELSE NULL
		END) AS Importe
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3
			ON t2.IdTexto = t3.IdTexto
	WHERE
		t3.CodInterno IS NULL
		AND t3.IdMateria IS NULL
		AND t1.IdPedido = p_idPedido
	GROUP BY
		t1.IdPedido;
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selGabineteItems
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selGabineteItems`(IN `p_idPedido` INT)
    READS SQL DATA
BEGIN
	SELECT
		t2.IdPedidoItem AS IdItem,
		t3.Nombre,
		t3.Docente,
		t3.CantPaginas AS Hojas,
		t2.Cantidad,
		t2.Anillado,
		t2.Abrochado,
		t2.SimpleFaz,
		t3.CantPaginas * IF(t3.IdTipoTexto NOT IN (4, 5), fn_getConfiguracion('PrecioCEIT'), fn_getConfiguracion('PrecioGabinete')) AS Costo,
		t2.IdEstadoItem,
		'gettp' AS TipoAccion,
		t3.IdTexto AS RutaArchivo
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3
			ON t2.IdTexto = t3.IdTexto
	WHERE
		t3.CodInterno IS NULL
		AND t3.IdMateria IS NULL
		AND t3.CantPaginas <= 50
		AND t1.IdPedido = p_idPedido;
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selGabinetePedido
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selGabinetePedido`(IN `p_idPedido` INT)
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPedido,
		t1.IdUsuario,
		t1.Creado,
		t1.CreadoPor,
		t1.Modificado,
		t1.ModificadoPor,
		t1.Anillado,
		t1.Comentario,
		t1.PosicionX,
		t1.PosicionY,
		t1.Retiro,
		t1.IdFranja,
		t1.Pagado,
