-- Volcando estructura para procedimiento ceit.sp_selGabinetePedidoEstado
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selGabinetePedidoEstado`(IN `p_idPedido` INT)
    READS SQL DATA
BEGIN
	SELECT
		t4.Descripcion
	FROM pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3
			on t2.IdTexto = t3.IdTexto
		INNER JOIN pedidoestados AS t4
			on t1.IdEstado = t4.IdPedidoEstados
