-- Volcando estructura para procedimiento ceit.sp_selGabinetePedidos
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selGabinetePedidos`()
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPedido AS IdGabinetePedido,
		t6.Legajo,
		t1.Retiro,
		t7.Descripcion AS Estado,
		t1.Creado
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3 
			ON t2.IdTexto = t3.IdTexto
		INNER JOIN usuarios AS t4 
			ON t1.IdUsuario = t4.IdUsuario
		INNER JOIN personas AS t5 
			ON t4.IdPersona = t5.IdPersona
		INNER JOIN estudiantes AS t6 
			ON t5.IdPersona = t6.IdPersona
		INNER JOIN pedidoestados AS t7 
			ON t1.IdEstado = t7.IdPedidoEstados
	WHERE
		t1.Especial = 0
		AND t3.CantPaginas <= 50
		AND t3.CodInterno IS NULL
		AND t3.IdMateria IS NULL
		AND t1.IdEstado IN (1, 2, 3)
	ORDER BY
		t1.IdEstado DESC,
		t1.Retiro ASC;
END//
DELIMITER ;


