-- Volcando estructura para procedimiento ceit.sp_selPedidoCaja
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidoCaja`(IN `p_idPedido` INT)
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPedido,
		IFNULL(t1.Comentario, t3.Nombre) AS Descripcion,
		SUM((t3.CantPaginas * t2.Cantidad * fn_getConfiguracion('PrecioCEIT')) +
		CASE t1.Anillado
			WHEN 0 THEN IF(t2.Anillado, t2.Anillado * t2.Cantidad * fn_getConfiguracion('PrecioAnillado'), 0)
			WHEN 1 THEN fn_getConfiguracion('PrecioAnillado')
			ELSE NULL
		END) AS PrecioUnitario,
		1 AS Cantidad,
		SUM((t3.CantPaginas * t2.Cantidad * fn_getConfiguracion('PrecioCEIT')) +
		CASE t1.Anillado
			WHEN 0 THEN IF(t2.Anillado, t2.Anillado * t2.Cantidad * fn_getConfiguracion('PrecioAnillado'), 0)
			WHEN 1 THEN fn_getConfiguracion('PrecioAnillado')
			ELSE NULL
		END) AS Importe
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3
			ON t2.IdTexto = t3.IdTexto
	WHERE
		t1.IdPedido = p_idPedido
	GROUP BY
		t1.IdPedido;
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selPedidoDisponibilidad
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidoDisponibilidad`()
BEGIN
	-- Declaro variable y le coloco, dentro, los minutos faltantes de trabajo a terminar.
	SET @minutos_trabajo_restante = 0;
	SELECT
		IFNULL(SUM(t2.Cantidad * t3.CantPaginas) / fn_getConfiguracion('FotocopiasXMinuto'), 0)
	INTO
		@minutos_trabajo_restante
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
			AND t2.IdEstadoItem IN (1, 2)
		INNER JOIN textos AS t3
			ON t2.IdTexto = t3.IdTexto;

	-- SELECT @minutos_trabajo_restante;

	-- Guardo la tabla de franjas horarias para ser usada mas tarde en horas.
	DROP TEMPORARY TABLE IF EXISTS tmpFranjas;
	CREATE TEMPORARY TABLE tmpFranjas (
		idFranja INT UNSIGNED NOT NULL,
		CantTiempo INT UNSIGNED NOT NULL DEFAULT 0
	) ENGINE=MEMORY;
	
	SET @curRow = 0;
		tmpFranjas
	SELECT
		@curRow := @curRow + 1 AS idFranja,
		(t1.Hasta - t1.Desde) AS CantTiempo
	FROM
		horariofranjas AS t1;
	
	-- Guardo los minutos totales de un dia laboral.
	SET @total_minutos_dia_laboral = 0;
	SELECT
		SUM(t1.Hasta - t1.Desde) * 60
	INTO
		@total_minutos_dia_laboral
	FROM
		horariofranjas AS t1;
		
	-- Guardo la cantidad de dias necesarios para realizar un trabajo
	SET @dias_necesarios = @minutos_trabajo_restante / @total_minutos_dia_laboral;
	
	-- SELECT @dias_necesarios, @minutos_trabajo_restante, @total_minutos_dia_laboral, @minutos_trabajo_restante / @total_minutos_dia_laboral;
	
	-- Obtengo el dia del retorno
	SET @dia_retorno = DATE_ADD(CURDATE(), INTERVAL FLOOR(@dias_necesarios) DAY);
	
	-- SELECT @dia_retorno AS DiaRetornoLimpio;
	
	-- Me fijo si hace un cambio de semana.
	SET @dia_retorno = DATE_ADD(@dia_retorno, INTERVAL ((WEEK(CURDATE()) - WEEK(CAST(@dia_retorno AS DATE))) * 2) DAY);
	
	-- SELECT @dia_retorno AS DiaRetornoConCambioDeSemana;
	
	-- Saco en que franja horaria va a caer.
	SET @minutos_retiro = (@dias_necesarios - FLOOR(@dias_necesarios)) * @total_minutos_dia_laboral;
	
	-- SELECT @minutos_retiro AS Resultado, FLOOR(@dias_necesarios) AS ParteEnteraDiasNecesarios;
	
	-- Verifico en que franja cae.
	SET @aux = @minutos_retiro;
	SET @counter = (SELECT t1.IdHorarioFranja
					FROM horariofranjas AS t1
					WHERE CURTIME() BETWEEN LPAD(CONCAT(t1.Desde, ':00:00'), 8, '0') AND LPAD(CONCAT(t1.Hasta, ':00:00'), 8, '0'));

	WHILE @aux > 0 DO
		SET @counter = IFNULL(@counter, 0) + 1;
		SET @aux = @aux - (SELECT CantTiempo * 60
						   FROM tmpFranjas
						   WHERE idFranja = @counter);
	END WHILE;
	
	-- SELECT @counter AS FranjaHorariaPosible;
	
	-- Le agrego una franja horaria.
	SET @counter = @counter + 1;
	
	-- SELECT @dia_retorno;
	
	IF CURTIME() > (SELECT CAST(CONCAT(t1.Hasta, ':00:00') AS TIME) FROM horariofranjas AS t1 ORDER BY t1.Hasta DESC LIMIT 1) THEN
		SET @dia_retorno = DATE_ADD(@dia_retorno, INTERVAL 1 DAY);
	END IF;
	
	-- SELECT CURTIME(), (SELECT CAST(CONCAT(t1.Hasta, ':00:00') AS TIME) FROM horariofranjas AS t1 ORDER BY t1.Hasta DESC LIMIT 1), @dia_retorno;
	
	-- Verifico si me pase de franja.
	IF @counter > 5 THEN
		SET @dia_retorno = DATE_ADD(@dia_retorno, INTERVAL 1 DAY);
		SET @counter = 1;
	END IF;
	
	-- SELECT DAYOFWEEK(@dia_retorno);
	
	CASE DAYOFWEEK(@dia_retorno)
		WHEN 1 THEN SET @dia_retorno = DATE_ADD(@dia_retorno, INTERVAL 1 DAY);
		WHEN 7 THEN SET @dia_retorno = DATE_ADD(@dia_retorno, INTERVAL 2 DAY);
		ELSE SET @dia_retorno = @dia_retorno;
	END CASE;
	
	-- SELECT @dia_retorno, @counter;
	
	-- Muestro el resultado.
	SELECT
		@dia_retorno AS DiaRetiro,
		@counter AS FranjaHoraria,
		CONCAT(t1.Desde, ':00') AS HoraRetiro
	FROM
		horariofranjas AS t1
	WHERE
		t1.IdHorarioFranja = @counter;
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selPedidoEspecialByIdEstado
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidoEspecialByIdEstado`(IN `p_idEstado` TINYINT)
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPedido,
		t2.Descripcion AS Estado,
		t1.Creado,
		t1.Comentario,
		t1.Retiro,
		CONCAT(t3.Desde, ' hs.') AS FranjaHoraria,
		SUM((t5.CantPaginas * IF(t4.SimpleFaz = 0, IF(t5.IdTipoTexto IN (2), fn_getConfiguracion('PrecioCEIT'), fn_getConfiguracion('PrecioGabinete')), fn_getConfiguracion('PrecioSimpleFaz')) + IF(t1.Anillado = 0 AND t4.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0)) * t4.Cantidad) + IF(t1.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0) AS Precio
	FROM
		pedidos AS t1
		INNER JOIN pedidoestados AS t2
			ON t1.IdEstado = t2.IdPedidoEstados
		INNER JOIN horariofranjas AS t3
			ON t1.IdFranja = t3.IdHorarioFranja
		INNER JOIN pedidoitems AS t4
			ON t1.IdPedido = t4.IdPedido
		INNER JOIN textos AS t5
			ON t4.IdTexto = t5.IdTexto
	WHERE
		t1.IdEstado = p_idEstado
		AND t1.Especial = 1
	GROUP BY
		t1.IdPedido
	ORDER BY
		t1.Retiro ASC
	LIMIT 20;
END//
DELIMITER ;


