-- Volcando estructura para procedimiento ceit.sp_selPedidoForDeliver
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidoForDeliver`()
    READS SQL DATA
BEGIN
	SELECT DISTINCT
		t1.IdPedido,
		t4.Legajo,
		t3.Apellido,
		t1.Comentario,
		CONCAT(t8.Descripcion, ' ', t9.Descripcion) AS Posicion,
		t1.Retiro,
		t5.Descripcion AS Franja
	FROM
		pedidos AS t1
		INNER JOIN usuarios AS t2
			ON t1.IdUsuario = t2.IdUsuario
		INNER JOIN personas AS t3
			ON t2.IdPersona = t3.IdPersona
		INNER JOIN estudiantes AS t4
			ON t3.IdPersona = t4.IdPersona
		INNER JOIN horariofranjas AS t5
			ON t1.IdFranja = t5.IdHorarioFranja
		INNER JOIN cajaitems AS t6
			ON t1.IdPedido = t6.IdPedido
		INNER JOIN caja AS t7
			ON t6.IdCaja = t7.IdCaja
		LEFT JOIN pedidosposicionx AS t8
			ON t1.PosicionX = t8.IdPosicionX
		LEFT JOIN pedidosposiciony AS t9
			ON t1.PosicionY = t9.IdPosicionY
	WHERE
		t1.Pagado = 1
		AND t1.IdEstado IN (4)
		AND t7.Creado BETWEEN NOW() - INTERVAL 30 MINUTE AND NOW();
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selPedidoForDeliverByIdPedidoOrLegajo
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidoForDeliverByIdPedidoOrLegajo`(IN `p_id` INT)
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPedido,
		t4.Legajo,
		t3.Apellido,
		t1.Comentario,
		CONCAT(t6.Descripcion, ' ', t7.Descripcion) AS Posicion,
		t1.Retiro,
		t5.Descripcion AS Franja
	FROM
		pedidos AS t1
		INNER JOIN usuarios AS t2
			ON t1.IdUsuario = t2.IdUsuario
		INNER JOIN personas AS t3
			ON t2.IdPersona = t3.IdPersona
		INNER JOIN estudiantes AS t4
			ON t3.IdPersona = t4.IdPersona
		INNER JOIN horariofranjas AS t5
			ON t1.IdFranja = t5.IdHorarioFranja
		LEFT JOIN pedidosposicionx AS t6
			ON t1.PosicionX = t6.IdPosicionX
		LEFT JOIN pedidosposiciony AS t7
			ON t1.PosicionY = t7.IdPosicionY
	WHERE
