-- Volcando estructura para procedimiento ceit.sp_selPedidoItems
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidoItems`(IN `p_idPedido` INT)
    READS SQL DATA
BEGIN
	SELECT
		t2.IdPedidoItem AS IdItem,
		CONCAT(LPAD(t6.Codigo, 2, 0), '-', t5.Ano, LPAD(t4.CodMateria, 2, 0), '-', LPAD(t3.IdTexto, 3, 0)) AS Codigo,
		t3.Nombre,
		t3.Docente,
		t4.Descripcion AS Materia,
		t3.CantPaginas AS Hojas,
		t2.Cantidad,
		t2.Anillado,
		t2.Abrochado,
		t2.SimpleFaz,
		t3.IdTipoTexto,
		t3.CantPaginas * IF(t3.IdTipoTexto NOT IN (4, 5), fn_getConfiguracion('PrecioCEIT'), fn_getConfiguracion('PrecioGabinete')) AS Costo,
		t2.IdEstadoItem,
		IF(t3.IdTipoTexto NOT IN (4, 5), 'getpdf', 'gettp') AS TipoAccion,
		CASE
			WHEN t3.IdMateria IS NULL THEN CONCAT(t3.IdTexto)
			ELSE CONCAT(t6.Codigo, '/', t5.Ano, '/', t4.CodMateria, '/', t3.IdTipoContenido, '/', t3.CodInterno)
		END AS RutaArchivo
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3
			ON t2.IdTexto = t3.IdTexto
		LEFT JOIN materias AS t4
			ON t3.IdMateria = t4.IdMateria
		LEFT JOIN niveles AS t5
			ON t4.IdNivel = t5.IdNivel
		LEFT JOIN carreras AS t6
			ON t5.IdCarrera = t6.IdCarrera
	WHERE
		t1.IdPedido = p_idPedido
	ORDER BY
		t2.IdPedidoItem ASC;
END//
DELIMITER ;


