-- Volcando estructura para procedimiento ceit.sp_selPedidos
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidos`()
    READS SQL DATA
BEGIN
	-- Este select trae los pedidos NO TP.
	(SELECT
		t1.IdPedido,
		t1.Creado,
		t1.Comentario,
		t1.Retiro,
		t2.Descripcion AS Estado,
		CONCAT(t3.Desde, ' hs.') AS FranjaHoraria,
		SUM((t5.CantPaginas * IF(t4.SimpleFaz = 0, IF(t5.IdTipoTexto IN (2), fn_getConfiguracion('PrecioCEIT'), fn_getConfiguracion('PrecioGabinete')), fn_getConfiguracion('PrecioSimpleFaz')) + IF(t1.Anillado = 0 AND t4.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0)) * t4.Cantidad) + IF(t1.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0) AS Precio
	FROM
		pedidos AS t1
		INNER JOIN pedidoestados AS t2
			ON t1.IdEstado = t2.IdPedidoEstados
		INNER JOIN horariofranjas AS t3
			ON t1.IdFranja = t3.IdHorarioFranja
		INNER JOIN pedidoitems AS t4
			ON t1.IdPedido = t4.IdPedido
		INNER JOIN textos AS t5
			ON t4.IdTexto = t5.IdTexto
			AND t5.CodInterno IS NOT NULL
			AND t5.IdMateria IS NOT NULL
	WHERE
		t1.IdEstado IN (1, 2, 3)
		AND t1.Especial = 0
	GROUP BY
		t1.IdPedido
	ORDER BY
		t1.IdEstado DESC,
		t1.Retiro ASC,
		t1.IdFranja ASC)
	
	UNION
	
	-- Este select trae los pedidos TP con cant hojas mayor a 50.
	(SELECT
		t1.IdPedido,
		t1.Creado,
		t1.Comentario,
		t1.Retiro,
		t2.Descripcion AS Estado,
		CONCAT(t3.Desde, ' hs.') AS FranjaHoraria,
		SUM((t5.CantPaginas * IF(t4.SimpleFaz = 0, IF(t5.IdTipoTexto IN (2), fn_getConfiguracion('PrecioCEIT'), fn_getConfiguracion('PrecioGabinete')), fn_getConfiguracion('PrecioSimpleFaz')) + IF(t1.Anillado = 0 AND t4.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0)) * t4.Cantidad) + IF(t1.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0) AS Precio
	FROM
		pedidos AS t1
		INNER JOIN pedidoestados AS t2
			ON t1.IdEstado = t2.IdPedidoEstados
		INNER JOIN horariofranjas AS t3
			ON t1.IdFranja = t3.IdHorarioFranja
		INNER JOIN pedidoitems AS t4
			ON t1.IdPedido = t4.IdPedido
		INNER JOIN textos AS t5
			ON t4.IdTexto = t5.IdTexto
			AND t5.CantPaginas > 50
			AND t5.CodInterno IS NULL
			AND t5.IdMateria IS NULL
	WHERE
		t1.IdEstado IN (1, 2, 3)
		AND t1.Especial = 0
	GROUP BY
		t1.IdPedido
	ORDER BY
		t1.IdEstado DESC,
		t1.Retiro ASC,
		t1.IdFranja ASC);
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selPedidosByIdEstado
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidosByIdEstado`(IN `p_idEstado` INT)
    READS SQL DATA
BEGIN
	-- Textos del sistema.
	SELECT
		t1.IdPedido,
		t2.Descripcion AS Estado,
		t1.Creado,
		t1.Comentario,
		t1.Retiro,
		CONCAT(t3.Desde, ' hs.') AS FranjaHoraria,
		SUM(
			(t5.CantPaginas
			*
			IF(t4.SimpleFaz = 0,
				IF(t5.IdTipoTexto IN (2), fn_getConfiguracion('PrecioCEIT'), fn_getConfiguracion('PrecioGabinete')),
				fn_getConfiguracion('PrecioSimpleFaz')
			  )
			  +
			  IF(t1.Anillado = 0 AND t4.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0)
			)
		)
		+
		IF(t1.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0) AS Precio
	FROM
		pedidos AS t1
		INNER JOIN pedidoestados AS t2
			ON t1.IdEstado = t2.IdPedidoEstados
		INNER JOIN horariofranjas AS t3
			ON t1.IdFranja = t3.IdHorarioFranja
		INNER JOIN pedidoitems AS t4
			ON t1.IdPedido = t4.IdPedido
		INNER JOIN textos AS t5
			ON t4.IdTexto = t5.IdTexto
	WHERE
		t1.IdEstado = p_idEstado
		AND t5.CodInterno IS NOT NULL
		AND t5.IdMateria IS NOT NULL
		AND t1.Especial = 0
	GROUP BY
		t1.IdPedido
	
	UNION
	
	-- Textos digitales con mas de 50 hojas
	SELECT
		t1.IdPedido,
		t2.Descripcion AS Estado,
		t1.Creado,
		t1.Comentario,
		t1.Retiro,
		CONCAT(t3.Desde, ' hs.') AS FranjaHoraria,
		SUM(
			(t5.CantPaginas
			*
			IF(t4.SimpleFaz = 0,
				IF(t5.IdTipoTexto IN (2), fn_getConfiguracion('PrecioCEIT'), fn_getConfiguracion('PrecioGabinete')),
				fn_getConfiguracion('PrecioSimpleFaz')
			  )
			  +
			  IF(t1.Anillado = 0 AND t4.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0)
			)
		)
		+
		IF(t1.Anillado = 1, fn_getConfiguracion('PrecioAnillado'), 0) AS Precio
	FROM
		pedidos AS t1
		INNER JOIN pedidoestados AS t2
			ON t1.IdEstado = t2.IdPedidoEstados
		INNER JOIN horariofranjas AS t3
			ON t1.IdFranja = t3.IdHorarioFranja
		INNER JOIN pedidoitems AS t4
			ON t1.IdPedido = t4.IdPedido
		INNER JOIN textos AS t5
			ON t4.IdTexto = t5.IdTexto
	WHERE
		t1.IdEstado = p_idEstado
		AND t5.CodInterno IS NULL
		AND t5.IdMateria IS NULL
		AND t5.CantPaginas > 50
		AND t1.Especial = 0
	GROUP BY
		t1.IdPedido
	ORDER BY
		Retiro ASC
	LIMIT 20;
END//
DELIMITER ;


-- Volcando estructura para procedimiento ceit.sp_selPedidosByIdPedidoOrDNI
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selPedidosByIdPedidoOrDNI`(IN `p_id` VARCHAR(10))
    READS SQL DATA
BEGIN
	-- Pedidos del sistema
	SELECT
		t1.IdPedido,
		t5.DNI,
		t5.Nombre,
		t5.Apellido,
		t1.Retiro AS DiaRetiro,
		t7.Descripcion AS HorarioRetiro,
		t8.Descripcion AS Estado
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3
			ON t2.IdTexto = t3.IdTexto
		INNER JOIN usuarios AS t4
			ON t1.IdUsuario = t4.IdUsuario
		INNER JOIN personas AS t5
			ON t4.IdPersona = t5.IdPersona
		LEFT JOIN estudiantes AS t6
			ON t5.IdPersona = t6.IdPersona
		INNER JOIN horariofranjas AS t7
			ON t1.IdFranja = t7.IdHorarioFranja
		INNER JOIN pedidoestados AS t8
			ON t1.IdEstado = t8.IdPedidoEstados
	WHERE
		t1.IdEstado >= 3
		AND	t1.Pagado = 0
		AND t3.CodInterno IS NOT NULL
		AND t3.IdMateria IS NOT NULL
		AND (t5.DNI LIKE CONCAT('%', p_id, '%') OR t1.IdPedido LIKE CONCAT('%', p_id, '%'))
	UNION
	
	-- Pedidos de gabinete con mas de 50 hojas.
	SELECT
		t1.IdPedido,
		t5.DNI,
		t5.Nombre,
		t5.Apellido,
		t1.Retiro AS DiaRetiro,
		t7.Descripcion AS HorarioRetiro,
		t8.Descripcion AS Estado
	FROM
		pedidos AS t1
		INNER JOIN pedidoitems AS t2
			ON t1.IdPedido = t2.IdPedido
		INNER JOIN textos AS t3
			ON t2.IdTexto = t3.IdTexto
		INNER JOIN usuarios AS t4
			ON t1.IdUsuario = t4.IdUsuario
		INNER JOIN personas AS t5
			ON t4.IdPersona = t5.IdPersona
		LEFT JOIN estudiantes AS t6
			ON t5.IdPersona = t6.IdPersona
		INNER JOIN horariofranjas AS t7
			ON t1.IdFranja = t7.IdHorarioFranja
		INNER JOIN pedidoestados AS t8
			ON t1.IdEstado = t8.IdPedidoEstados
	WHERE
		t1.IdEstado >= 3
		AND t1.Pagado = 0
		AND t3.IdMateria IS NULL
		AND t3.CodInterno IS NULL
		AND t3.CantPaginas > 50
		AND (t5.DNI LIKE CONCAT('%', p_id, '%') OR t1.IdPedido LIKE CONCAT('%', p_id, '%'));
END//
DELIMITER ;


