		INNER JOIN horariofranjas AS t7
			ON t1.IdFranja = t7.IdHorarioFranja
		INNER JOIN pedidoestados AS t8
			ON t1.IdEstado = t8.IdPedidoEstados
	WHERE
		t1.IdEstado IN (4)
		AND t1.Pagado = 0
		AND t1.Especial = 0
		AND t3.CodInterno IS NULL
		AND t3.IdMateria IS NULL
		AND t3.CantPaginas > 50;
END//
DELIMITER ;


