-- Volcando estructura para procedimiento ceit.sp_selTexto
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selTexto`(IN `p_idTexto` INT)
    READS SQL DATA
BEGIN
	SELECT
		t1.IdTexto,
		CONCAT(LPAD(t4.Codigo, 2, 0), '-', t3.Ano, LPAD(t2.CodMateria, 2, 0), '-', LPAD(t1.CodInterno, 3, 0)) AS CodigoInterno,
		t1.CodInterno,
		t4.Descripcion AS Carrera,
		t2.Descripcion AS Materia,
		t1.Nombre AS Titulo,
		t1.Autor,
		t1.Docente,
		t4.IdCarrera,
		t3.IdNivel,
		t2.IdMateria,
		t1.CantPaginas AS Paginas,
		t1.CantPaginas * fn_getConfiguracion('Precioceit') AS Precio,
		t1.IdTipoContenido,
		t1.Activo,
		t1.CreadoPor,
		t1.CreadoDia AS Creado,
		CONCAT(t4.Codigo, '/', t3.Ano, '/', t2.CodMateria, '/', t1.IdTipoContenido, '/', t1.CodInterno) AS RutaArchivo
	FROM
		textos AS t1
		INNER JOIN materias AS t2	
			ON t1.IdMateria = t2.IdMateria
		INNER JOIN niveles AS t3
			ON t2.IdNivel = t3.IdNivel
		INNER JOIN carreras AS t4 
			ON t3.IdCarrera = t4.IdCarrera
	WHERE
		t1.IdTexto = p_idTexto;
END//
DELIMITER ;


