-- Volcando estructura para procedimiento ceit.sp_selTextosPagination
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selTextosPagination`(IN `p_page` INT, IN `p_quantity` INT)
    READS SQL DATA
BEGIN
	DECLARE sql_stmt VARCHAR(5000) DEFAULT NULL;
	DECLARE limit_clause VARCHAR(100) DEFAULT NULL;

	IF (p_page - 1) * p_quantity IS NOT NULL AND p_quantity IS NOT NULL THEN
		SET limit_clause = CONCAT('LIMIT ', (p_page - 1) * p_quantity, ', ', p_quantity);
	ELSE
		SET limit_clause = NULL;
	END IF;

	SET sql_stmt = CONCAT('SELECT
								t1.IdTexto,
								CONCAT(LPAD(t4.Codigo, 2, 0), \'-\', t3.Ano, LPAD(t2.CodMateria, 2, 0), \'-\', LPAD(t1.CodInterno, 3, 0)) AS CodigoInterno,
								t4.Descripcion AS Carrera,
								CONCAT(LEFT(t2.Descripcion, 27), IF(LENGTH(t2.Descripcion) > 27, \'...\', \'\')) AS Materia,
								CONCAT(LEFT(t1.Nombre, 47), IF(LENGTH(t1.Nombre) > 47, \'...\', \'\')) AS Titulo,
								t1.Autor,
								t1.Docente,
								t1.CantPaginas AS Paginas,
								t1.CantPaginas * fn_getConfiguracion(\'Precioceit\') AS Precio,
								t1.Activo,
								t1.CreadoDia AS Creado,
								CONCAT(t4.Codigo, \'/\', t3.Ano, \'/\', t2.CodMateria, \'/\', t1.IdTipoContenido, \'/\', t1.CodInterno) AS RutaArchivo
							FROM
								textos AS t1
								INNER JOIN materias AS t2	
									ON t1.IdMateria = t2.IdMateria
								INNER JOIN niveles AS t3
									ON t2.IdNivel = t3.IdNivel
								INNER JOIN carreras AS t4 
									ON t3.IdCarrera = t4.IdCarrera', ' ', limit_clause);
			
	SET @s = sql_stmt;
	PREPARE stmt FROM @s;
	EXECUTE stmt;
END//
DELIMITER ;


