-- Volcando estructura para procedimiento ceit.sp_selUsuario
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selUsuario`(IN `p_idUsuario` INT)
    READS SQL DATA
BEGIN
	SELECT
		t1.IdPersona,
		t2.IdUsuario,
		COALESCE(t2.Usuario, t1.DNI) AS Usuario,
		COALESCE(t2.Contrasena, t3.Legajo, t4.Legajo) AS Contrasena,
		t1.Nombre,
		t1.Apellido,
		t1.DNI,
		COALESCE(t3.Legajo, t4.Legajo) AS Legajo,
		t3.IdCarrera,
		t1.Email,
		t2.EmailValidado,
		t1.Telefono,
		t1.Celular,
		CASE
			WHEN t3.IdEstudiante IS NOT NULL THEN 'Estudiante'
			WHEN t4.IdDocente IS NOT NULL THEN 'Docente'
			ELSE 'Operario'
		END AS TipoUsuario
	FROM
		personas AS t1
		INNER JOIN usuarios AS t2
			ON t1.IdPersona = t2.IdPersona
		LEFT JOIN estudiantes AS t3
			ON t1.IdPersona = t3.IdPersona
		LEFT JOIN docentes AS t4
			ON t1.IdPersona = t4.IdPersona
	WHERE
		t2.IdUsuario = p_idUsuario;
END//
DELIMITER ;


