-- Volcando estructura para procedimiento ceit.sp_selUsuarioByLegajoOrDNI
DELIMITER //
CREATE DEFINER=`apuntec`@`localhost` PROCEDURE `sp_selUsuarioByLegajoOrDNI`(IN `p_legajoDNI` INT)
    READS SQL DATA
BEGIN
	SELECT
	t1.IdUsuario,
	t1.Usuario,
	t2.IdPersona,
	t2.Nombre,
	t2.Apellido,
	t2.DNI,
	t2.Telefono,
	t2.Celular,
	IFNULL(t3.Legajo, t4.Legajo) AS Legajo
	FROM
		usuarios AS t1
		INNER JOIN personas AS t2
			ON t1.IdPersona = t2.IdPersona
		LEFT JOIN estudiantes AS t3
			ON t1.IdPersona = t3.IdPersona
		LEFT JOIN docentes AS t4
			ON t1.IdPersona = t4.IdPersona
	WHERE
		t2.DNI = p_legajoDNI
		OR (t3.Legajo = p_legajoDNI OR t4.Legajo = p_legajoDNI)
	LIMIT 10;
END//
DELIMITER ;


